import Carousel from 'react-images';

const images = [{ src: "https://www.google.de/imgres?imgurl=http%3A%2F%2Fihg.scene7.com%2Fis%2Fimage%2Fihg%2Fholiday-inn-the-colony-4629618286-4x3&imgrefurl=https%3A%2F%2Fwww.ihg.com%2Fholidayinn%2Fhotels%2Fus%2Fen%2Fthe-colony%2Fdfwct%2Fhoteldetail&docid=H8mJy-LC-BuN2M&tbnid=_p5ca9DimO_r-M%3A&vet=10ahUKEwj_zenOo5bjAhUfXRUIHW95ALAQMwhTKAEwAQ..i&w=4000&h=3000&bih=415&biw=954&q=image%20hotel&ved=0ahUKEwj_zenOo5bjAhUfXRUIHW95ALAQMwhTKAEwAQ&iact=mrc&uact=8", 
 src: '' }];

class Activty extends React.Component {
  render() { 
    return (
        <Carousel views={images} />
    );
  }
}

export default Activty;
